import React from 'react'
import './style.css'

const List = ({ items }) => {

  return (
    <>
      <div className='list__item'>
        {items.map((item, index) => {
          if (item.avatarUrl && item.avatarUrl.url) {
            return (
              <img key={index} src={item.avatarUrl.url}></img>
            )
          }
        })}
      </div>
    </>
  )
}

export default List
